export default (state = {}, action) => {
  switch (action.type) {
    case 'SET_DATA_PARSED_IN_ARR':
      return Object.assign({}, state, {dataParsedInArr: action.dataParsedInArr});
    case 'SET_DATA':
      return Object.assign({}, state, {responseData: action.responseData});
    default:
      return state;
  }
};
